  //检查获取投注结果
  getlotteryresult: function getlotteryresult() {
    console.log("检查投注结果");
    var buylotteryList = cache.get("buylotteryList");
    if (buylotteryList == null || buylotteryList == "undefined") return;
    if (buylotteryList.length == 0) return;
    var id = buylotteryList[0];
    var ukey = cache.get("ukey");

    if (ukey == "" || ukey == 0 || ukey == "undefined") {
      location.href = "login.html";
      return;
    }

    var uid = cache.get("uid");

    if (uid == "" || uid == 0 || uid == "undefined" || uid == null) {
      location.href = "login.html";
      return;
    }

    console.log("向服务器结单投注：id=" + id);
    rq(sys.userapi, {
      action: "getlotteryresult",
      userkey: ukey,
      id: id
    }, function (cb) {
      switch (cb.code) {
        case 1:
          console.log("失败", 2);
          return;

        case 2:
          comm.tip("登录超时,请重新登录", 2);
          setTimeout(function () {
            location.href = "login.html";
          }, 1000);
          return;

        case 3:
          return;

        case 4:
          console.log("查询数据出错");
          return;

        case 5:
          console.log("已经结算");
          buylotteryList = comm.removeArray(buylotteryList, id);
          cache.set("buylotteryList", buylotteryList, 86400); //如果还有投注结果没结算的话

          if (buylotteryList.length > 0) {
            setTimeout(function () {
              appevent.getlotteryresult();
            }, 1000);
          }

          return;

        case 6:
          console.log("查询房间失败");
          return;

        case 99:
          //表示没有开这一期
          buylotteryList = comm.removeArray(buylotteryList, id);
          cache.set("buylotteryList", buylotteryList, 86400); //setTimeout(function () { appevent.getlotteryresult() }, 5000); comm.tip("99"); 

          return;

        case 999:
          setTimeout(function () {
            appevent.getlotteryresult();
          }, 5000);
          comm.tip("999");
          return;

        case 0:
          //                    buylotteryList.pop(id);
          buylotteryList = comm.removeArray(buylotteryList, id);
          cache.set("buylotteryList", buylotteryList, 86400); //                    cache.set("buylotteryid", 0, 86400);
          //记录最新头奖记录

          console.log(cb.data);
          var strmsg = "恭喜你第" + cb.data["LID"] + "期中奖：";

          if (cb.data["isD"] > 0) {
            strmsg += " 大";
          } else if (cb.data["isX"] > 0) {
            strmsg += " 小";
          } else if (cb.data["isDan"] > 0) {
            strmsg += " 单";
          } else if (cb.data["isShuang"] > 0) {
            strmsg += " 双";
          } else if (cb.data["isDD"] > 0) {
            strmsg += " 大单";
          } else if (cb.data["isDS"] > 0) {
            strmsg += " 大双";
          } else if (cb.data["isXD"] > 0) {
            strmsg += " 小单";
          } else if (cb.data["isXS"] > 0) {
            strmsg += " 小双";
          } else if (cb.data["isJD"] > 0) {
            strmsg += " 极大";
          } else if (cb.data["isJX"] > 0) {
            strmsg += " 极小";
          } else if (cb.data["isL"] > 0) {
            strmsg += " 龙";
          } else if (cb.data["isH"] > 0) {
            strmsg += " 虎";
          } else if (cb.data["isB"] > 0) {
            strmsg += " 豹";
          } else if (cb.data["isTM"] > -1) {
            strmsg += " 特码" + cb.data["isTM"] + "";
          } else if (cb.data["isDSBZ"] == 1) {
            strmsg += " 对子";
          } else if (cb.data["isDSBZ"] == 2) {
            strmsg += " 顺子";
          } else if (cb.data["isDSBZ"] == 3) {
            strmsg += " 豹子";
          } else {
            comm.information("很遗憾一个都没中");
            appevent.userpinfo();
            $("#petalbox").hide();
            return;
          }

          strmsg += " 获得金额" + cb.data["Amount"];
          comm.information(strmsg);
          $("#petalbox").show();
          comm.petalbox(); //下落红包

          setTimeout(function () {
            $("#petalbox").hide();
          }, 6500);
          /***获取今天时间***/

          var mydate = new Date();
          var str = "" + mydate.getFullYear();
          var mm = mydate.getMonth() + 1;

          if (mydate.getMonth() > 9) {
            str += "-" + mm + "-";
          } else {
            str += "-0" + mm + "-";
          }

          if (mydate.getDate() > 9) {
            str += mydate.getDate();
          } else {
            str += "0" + mydate.getDate();
          }

          str = Date.parse(new Date(str));
          str = str / 1000 - 28800;
          cache.del("getlotterybuyLog_" + str + uid); //清空今天保存投注记录

          appevent.userpinfo(); //刷新余额
          //如果还有投注结果没结算的话

          if (buylotteryList.length > 0) {
            setTimeout(function () {
              appevent.getlotteryresult();
            }, 1000);
          }

          break;
      }
    });
  },

