          strVar += "<div id=\"wfdiv\" style=\"width:1.8rem; height:0.45rem;position:absolute; top:3.99rem; left:38%; z-index:100;\" onclick=\"window.location.href='" + cb.data[1]["Link"] + "&typeid=1'\"><\/div>\n";
